// SPDX-License-Identifier: MIT
pragma solidity ^0.8.19;

/// @title SimpleSwap — minimal AMM-style swap + liquidity for a single token pair
/// @author ...
/// @notice Educational Simple AMM that supports adding/removing liquidity and swapping between two ERC20 tokens.

interface IERC20 {
    function totalSupply() external view returns (uint256);
    function balanceOf(address account) external view returns (uint256);
    function transfer(address to, uint256 value) external returns (bool);
    function allowance(address owner, address spender) external view returns (uint256);
    function approve(address spender, uint256 value) external returns (bool);
    function transferFrom(address from, address to, uint256 value) external returns (bool);
    function decimals() external view returns (uint8);
    event Transfer(address indexed from, address indexed to, uint256 value);
    event Approval(address indexed owner, address indexed spender, uint256 value);
}

/// @notice Simple ERC20 used for local testing in Remix.
/// @dev Minimal, NOT production-grade. Uses 18 decimals by default.
contract TestToken is IERC20 {
    string public name;
    string public symbol;
    uint8 public override decimals;
    uint256 private _totalSupply;

    mapping(address => uint256) private _balances;
    mapping(address => mapping(address => uint256)) private _allowances;

    constructor(string memory _name, string memory _symbol, uint8 _decimals, uint256 initialSupply) {
        name = _name;
        symbol = _symbol;
        decimals = _decimals;
        _mint(msg.sender, initialSupply * (10 ** _decimals));
    }

    function totalSupply() external view override returns (uint256) { return _totalSupply; }
    function balanceOf(address account) external view override returns (uint256) { return _balances[account]; }

    function transfer(address to, uint256 value) external override returns (bool) {
        require(_balances[msg.sender] >= value, "Insufficient balance");
        _balances[msg.sender] -= value;
        _balances[to] += value;
        emit Transfer(msg.sender, to, value);
        return true;
    }

    function allowance(address owner, address spender) external view override returns (uint256) {
        return _allowances[owner][spender];
    }

    function approve(address spender, uint256 value) external override returns (bool) {
        _allowances[msg.sender][spender] = value;
        emit Approval(msg.sender, spender, value);
        return true;
    }

    function transferFrom(address from, address to, uint256 value) external override returns (bool) {
        uint256 allowed = _allowances[from][msg.sender];
        require(_balances[from] >= value, "Insufficient balance");
        require(allowed >= value, "Allowance exceeded");
        _allowances[from][msg.sender] = allowed - value;
        _balances[from] -= value;
        _balances[to] += value;
        emit Transfer(from, to, value);
        return true;
    }

    // helper mint for testing (owner only omitted for brevity)
    function mint(address to, uint256 amount) external {
        _mint(to, amount);
    }

    function _mint(address to, uint256 amount) internal {
        _totalSupply += amount;
        _balances[to] += amount;
        emit Transfer(address(0), to, amount);
    }
}

/// @notice SimpleSwap: single-pair AMM with basic liquidity shares (LP accounting) and swap function.
/// @dev Educational: not audited. Do NOT use as-is in production.
contract SimpleSwap {
    address public immutable token0;
    address public immutable token1;

    uint112 private reserve0; // uses 112 bits like Uniswap v2 for compactness
    uint112 private reserve1;

    mapping(address => uint256) public liquidity; // LP shares per provider
    uint256 public totalLiquidity;

    // fee = 0.3% implemented as multiplier 997/1000
    uint256 private constant FEE_NUM = 997;
    uint256 private constant FEE_DEN = 1000;

    // basic reentrancy guard
    uint8 private locked = 1;

    error SameToken();
    error InsufficientInputAmount();
    error InsufficientLiquidity();
    error NotSupportedPair();
    error TransferFailed();

    event LiquidityAdded(address indexed provider, uint256 amount0, uint256 amount1, uint256 mintedShares);
    event LiquidityRemoved(address indexed provider, uint256 amount0, uint256 amount1, uint256 burnedShares);
    event Swapped(address indexed sender, address indexed fromToken, address indexed toToken, uint256 amountIn, uint256 amountOut);

    modifier lock() {
        require(locked == 1, "Reentrant");
        locked = 2;
        _;
        locked = 1;
    }

    constructor(address _token0, address _token1) {
        require(_token0 != _token1, "Identical tokens");
        token0 = _token0;
        token1 = _token1;
    }

    /// @notice Add liquidity to the pool. Caller must approve tokens beforehand.
    function addLiquidity(uint256 amount0, uint256 amount1) external lock returns (uint256 minted) {
        require(amount0 > 0 && amount1 > 0, "Zero amounts");

        // pull tokens
        _safeTransferFrom(IERC20(token0), msg.sender, address(this), amount0);
        _safeTransferFrom(IERC20(token1), msg.sender, address(this), amount1);

        // current reserves
        (uint256 _reserve0, uint256 _reserve1) = _getReserves();

        if (totalLiquidity == 0) {
            // first provider: mint sqrt(amount0 * amount1)
            minted = _sqrt(amount0 * amount1);
            require(minted > 0, "Insufficient liquidity minted");
        } else {
            // proportional minting
            uint256 minted0 = (amount0 * totalLiquidity) / _reserve0;
            uint256 minted1 = (amount1 * totalLiquidity) / _reserve1;
            minted = minted0 < minted1 ? minted0 : minted1; // min
            require(minted > 0, "Insufficient liquidity minted");
        }

        liquidity[msg.sender] += minted;
        totalLiquidity += minted;

        _updateReserves();
        emit LiquidityAdded(msg.sender, amount0, amount1, minted);
    }

    /// @notice Remove liquidity by burning your share.
    function removeLiquidity(uint256 share) external lock returns (uint256 amount0, uint256 amount1) {
        uint256 userShare = liquidity[msg.sender];
        require(share > 0 && userShare >= share, "Invalid share");
        require(totalLiquidity > 0, "No liquidity");

        (uint256 _reserve0, uint256 _reserve1) = _getReserves();

        amount0 = (share * _reserve0) / totalLiquidity;
        amount1 = (share * _reserve1) / totalLiquidity;

        liquidity[msg.sender] = userShare - share;
        totalLiquidity -= share;

        // transfer tokens back
        _safeTransfer(IERC20(token0), msg.sender, amount0);
        _safeTransfer(IERC20(token1), msg.sender, amount1);

        _updateReserves();
        emit LiquidityRemoved(msg.sender, amount0, amount1, share);
    }

    /// @notice Swap tokens inside the pool.
    /// @param fromToken the token the user sends in (must be token0 or token1)
    /// @param toToken the token the user wants out
    /// @param amountIn amount of fromToken sent (user must approve first)
    /// @param minAmountOut minimum acceptable amountOut (slippage protection)
    function swapTokens(address fromToken, address toToken, uint256 amountIn, uint256 minAmountOut) external lock returns (uint256 amountOut) {
        if (!(_isPairToken(fromToken) && _isPairToken(toToken))) revert NotSupportedPair();
        if (fromToken == toToken) revert SameToken();
        require(amountIn > 0, "Zero input");

        // fetch reserves BEFORE transfer
        (uint256 _reserveIn, uint256 _reserveOut) = fromToken == token0 ? (uint256(reserve0), uint256(reserve1)) : (uint256(reserve1), uint256(reserve0));

        // pull tokens; account for tokens with transfer fees by measuring actual received amount
        uint256 balanceBefore = IERC20(fromToken).balanceOf(address(this));
        _safeTransferFrom(IERC20(fromToken), msg.sender, address(this), amountIn);
        uint256 balanceAfter = IERC20(fromToken).balanceOf(address(this));
        uint256 actualAmountIn = balanceAfter - balanceBefore;
        if (actualAmountIn == 0) revert InsufficientInputAmount();

        // compute amount out using constant-product formula with fee
        amountOut = _getAmountOut(actualAmountIn, _reserveIn, _reserveOut);
        require(amountOut >= minAmountOut, "Slippage: amountOut < minAmountOut");
        require(amountOut > 0, "Zero output");

        // send out to user
        _safeTransfer(IERC20(toToken), msg.sender, amountOut);

        _updateReserves();
        emit Swapped(msg.sender, fromToken, toToken, actualAmountIn, amountOut);
    }

    /// @notice Returns current reserves.
    function getReserves() external view returns (uint112 r0, uint112 r1) {
        r0 = reserve0;
        r1 = reserve1;
    }

    /* ========== INTERNAL HELPERS ========== */

    function _isPairToken(address t) internal view returns (bool) {
        return (t == token0 || t == token1);
    }

    function _getReserves() internal view returns (uint256 r0, uint256 r1) {
        r0 = reserve0;
        r1 = reserve1;
    }

    function _updateReserves() internal {
        reserve0 = uint112(IERC20(token0).balanceOf(address(this)));
        reserve1 = uint112(IERC20(token1).balanceOf(address(this)));
    }

    /// @dev Uniswap-style amountOut calculation with fee applied to input
    function _getAmountOut(uint256 amountIn, uint256 _reserveIn, uint256 _reserveOut) internal pure returns (uint256) {
        if (_reserveIn == 0 || _reserveOut == 0) return 0;
        uint256 amountInWithFee = amountIn * FEE_NUM;
        uint256 numerator = amountInWithFee * _reserveOut;
        uint256 denominator = (_reserveIn * FEE_DEN) + amountInWithFee;
        return numerator / denominator;
    }

    function _safeTransfer(IERC20 token, address to, uint256 value) internal {
        bool ok = token.transfer(to, value);
        if (!ok) revert TransferFailed();
    }

    function _safeTransferFrom(IERC20 token, address from, address to, uint256 value) internal {
        bool ok = token.transferFrom(from, to, value);
        if (!ok) revert TransferFailed();
    }

    // integer sqrt
    function _sqrt(uint256 y) internal pure returns (uint256 z) {
        if (y > 3) {
            z = y;
            uint256 x = y / 2 + 1;
            while (x < z) {
                z = x;
                x = (y / x + x) / 2;
            }
        } else if (y != 0) {
            z = 1;
        }
    }
}

